            "_id": 1,
            "Story": "명랑하고 영민한 소녀. 자칭 촬영 같은 그 나이 또래들이 「좋아할 만한」 모든 것에 열광한다.<br>표류하던 만년빙에서 깨어났지만, 자신의 존재와 과거에 대해 아는 것이 하나도 없다는 것을 알아차린다. 잠시 고민하던 그녀는 자신이 다시 태어난 날짜를 이름으로 정한다.<br>이날 Mar. 7th가 「탄생」했다"
